import { NavLink } from "react-router-dom";
import {FaShoppingCart } from "react-icons/fa";
const Navbar = () => {
  
  return (
    <div >
      <nav className="max-w-[1080px] flex justify-between mx-auto">
        <div>
          <FaShoppingCart/>
          <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fpngtree.com%2Ffreepng%2Fshopping-logo-design_6020234.html&psig=AOvVaw1vZRBgHYeP_X94e4q2oqJb&ust=1693226616332000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCNC0uuvu_IADFQAAAAAdAAAAABAD" alt="logoImage"></img>
        </div>
        <div className="flex gap-2">
          <NavLink to="/">
            <div>Home</div>
          </NavLink>

          <NavLink to="/cart">
            <FaShoppingCart/>
          </NavLink>

        </div>
      </nav>
    </div>
  )
};

export default Navbar;
